import React from "react";
import ohkLogo from "../ohk-assets/ohklogo.png";
//import DummyComponent from "../components/DummyComponent";

function HeaderContainer() {
  return (
    <div>
      <div class="header">
          <img class="logo" src={ohkLogo} alt="ohk logo" />
          <button class="submission-btn"> Request Submission Page</button>
      </div>
      <div class="line"></div>
    </div>
  );
}

export default HeaderContainer;
